import React from "react";
import "./App.css";
import Main from "./layout/Main";
import { BrowserRouter } from "react-router-dom";
const App = () => {
  return (
    <>
      <BrowserRouter>
        <div>
          <Main />
        </div>
      </BrowserRouter>
    </>
  );
};
export default App;
